import React from 'react'
import './Styleguide.css';
const Styleguide = () => {
  return (
    <div>
      <h1>Design Process</h1>
      <p className='headings'>For this website i wanted to create a website coloring book which starts off with a minimal aesthetic and becomes colorful as the user interacts and engages with it. 
            The site in and of itself was/is to be considered internet art.</p>
      </div>

  );
}



export default Styleguide
